import logo from './logo.svg';
import './App.css';
import Home from './Component/Home/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
      <Switch>
          <Route path="/home">
            <Home/>

          </Route>

          <Route path="/">
            <Home />
          </Route>
        </Switch>
        </Router>
        <Home></Home>
      </header>
    </div>
  );
}

export default App;
